Victor Ortiz vs. Luis Collazo + Undercard (720p, 60 fps) FS1 
 The format is Mpeg2 file. 
 The overall quality is Excellent 
 The language is English  
 This is the Full Broadcast in 720P, at 60 FPS of the Golden Boy show from January 30, 2014.  This includes:

 1. Gary Russell, Jr. vs. Miguel Tomayo, 8 rounds, Jr. Lightweights
 2. Eddie Gomez vs. Daquan Arnett, 10 rounds, Jr. Middleweights
 3.Victor Ortiz vs. Luis Collazo, 12 rounds, Welterweights.

 All commentary is included.  Commercials are cut out.  Captured by a Tivo Premier from FS1HD, and converted to MPEG2 (ie removed tivo encoding).

 Some great exciting fights, and a must-have for collectors!






